import React from 'react';
import './App.css';
import Header from './components/lay-out/Header'
import contentBlockOne from './components/lay-out/content-block-one';

function App() {

  return (
    <div className="App"> 
     <Header/>
     <contentBlockOne/>
    </div>
  );
}

export default App;
